import { Box, Center, Flex, Grid, Stack, Text } from "@mantine/core";
import React from "react";

const Layout = () => {
  return (
    <Box bg="gray.400" h={200} style={{ borderRadius: "10px" }}>
  <Stack spacing={0}>
    <Box bg="lime.300" style={{ borderRadius: "10px 10px 0 0" }}>
      <Center>
        <Text>Test</Text>
      </Center>
    </Box>
    <Box bg="white" h={60} style={{ border: "1px solide " }}>
      {/* This is a blank box with a height of 60px */}
    </Box>
    <Box bg="white" h={60} style={{ borderRadius: "0" }}>
      {/* Another blank box with a height of 60px */}
    </Box>
    <Box bg="white" h={60} style={{ borderRadius: "0" }}>
      {/* Yet another blank box with a height of 60px */}
    </Box>
  </Stack>
</Box>
  );
};

export default Layout;
